import Result from '@/views/result/Result'
export default {
  name: "Step4",
  props:['userList'],
  components: {
    Result
  },
  data () {
    return {
      loading: false,
      time: 0,
    }
  },
  methods: {
    countDown(){
      let that = this;
      that.time--;
    }
  },
  mounted(){
    let that = this;
    that.time = 5;
    setInterval(that.countDown, 1000);
  },
  watch: {
    time: function (newVal,oldVal) {
      if (newVal == 0) {
        var params = {
          username: this.userList.username
        };
        this.$router.push({name: 'login', params})
      }
    }
  }
}
